import React from 'react';
import GalleryData from './GalleryData.js';

const Gallery = () => {
  const [gallerys, setgallerys] = React.useState(GalleryData);

  console.log(gallerys.mobile)

  let gallery = gallerys.map(x => {
    let {id, desktop, mobile} = x;
    return(
      <>
        <picture>
        <picture key ={id}>
        <source media="(min-width : 768px)" srcSet={desktop} />
        <img src={mobile} alt="gallery image"/>
      </picture>
        </picture>
      </>
    )
  })

  return (
    <div>
      {gallery}
    </div>
  )
}

export default Gallery;
